2803887722080936828=<ph name="BEGIN_H3">Fitur Debug<ph name="END_H3"><br>    <ph name="BR"><br>    Fitur debug di Perangkat Chrome OS dapat diaktifkan untuk memasang dan menguji kode khusus pada perangkat.  Sehingga Anda akan dapat:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">Menghapus verifikasi rootfs agar dapat memodifikasi file OS<br>      <ph name="LIST_ITEM">Mengaktifkan akses SSH ke perangkat menggunakan kunci pengujian standar agar dapat menggunakan alat seperti <ph name="BEGIN_CODE">'cros flash'<ph name="END_CODE"> untuk mengakses perangkat<br>      <ph name="LIST_ITEM">Mengaktifkan booting dari USB agar dapat memasang gambar OS dari perangkat USB<br>      <ph name="LIST_ITEM">Menyetel sandi masuk akar sistem maupun dev ke nilai khusus agar dapat melakukan SSH ke perangkat secara manual<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    Setelah diaktifkan, sebagian besar fitur debug akan tetap aktif meskipun powerwash dilakukan atau data pada perangkat yang dikelola perusahaan dihapus.  Untuk menonaktifkan semua fitur debug sepenuhnya, selesaikan proses pemulihan Chrome OS (https://support.google.com/chromebook/answer/1080595).<br>    <ph name="BR"><br>    <ph name="BR"><br>    Untuk informasi selengkapnya tentang fitur debug, lihat:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">Catatan:<ph name="END_BOLD">  Sistem akan melakukan boot ulang selama proses ini.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
